/**
 * Represents the axis range with minimum and maximum values.
 */
export interface AxisRange {
    /**
     * Specifies the axis minimum value.
     */
    min: number | Date;
    /**
     * Specifies the axis maximum value.
     */
    max: number | Date;
}
